import React, { useRef, useEffect, useState } from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';

const Container = styled.div`
  height: 100vh;
  overflow: hidden;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  padding: 20px;
`;

const WelcomeSection = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  text-align: center;
  background-image: url('https://images.unsplash.com/photo-1555685812-4b943f1cb0eb'); /* Replace with your background image URL */
  background-size: cover;
  background-repeat: no-repeat;
  background-position: center;
  padding: 20px;
`;

const WelcomeText = styled.h1`
  font-size: 36px;
  font-weight: bold;
  color: #ffffff; /* White text color */
  margin-bottom: 20px;
`;

const LogoImage = styled.img`
  width: 200px; /* Adjust the width as needed */
  height: auto;
  margin-bottom: 20px;
`;

const ButtonContainer = styled.div`
  display: flex;
  gap: 20px;
  margin-top: 20px;
`;

const HighlightedButton = styled(Link)`
  background-color: #007bff; /* Blue background color */
  color: white; /* White text color */
  text-decoration: none; /* Remove underlines */
  padding: 10px 20px;
  font-weight: bold;
  border-radius: 5px;
  transition: background-color 0.3s; /* Smooth transition on hover */

  &:hover {
    background-color: #0056b3; /* Darker blue color on hover */
  }
`;

const Slider = styled.div`
  display: flex;
  overflow: hidden;
  width: 100%;
`;

const Slide = styled.div`
  min-width: 100%;
`;

const Image = styled.img`
  width: 100%;
  height: auto;
`;

const Default = () => {
  const sliderRef = useRef(null);
  const [currentIndex, setCurrentIndex] = useState(0);
  const imageUrls = [
    'https://example.com/image1.jpg',
    'https://example.com/image2.jpg',
    'https://example.com/image3.jpg',
    'https://example.com/image4.jpg',
  ];

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentIndex((prevIndex) =>
        prevIndex === imageUrls.length - 1 ? 0 : prevIndex + 1
      );
    }, 5000); // Change image every 5 seconds

    return () => clearInterval(interval);
  }, []);

  useEffect(() => {
    if (sliderRef.current) {
      sliderRef.current.style.transform = `translateX(-${currentIndex * 100}%)`;
    }
  }, [currentIndex]);

  return (
    <Container>
      <Slider ref={sliderRef}>
        {imageUrls.map((imageUrl, index) => (
          <Slide key={index}>
            <Image src={imageUrl} alt={`Image ${index + 1}`} />
          </Slide>
        ))}
      </Slider>
      <WelcomeSection>
        <WelcomeText>Welcome to Task Manager</WelcomeText>
        <LogoImage
          src="https://images.search.yahoo.com/images/view;_ylt=AwrgxRxpPPxkurggaiCJzbkF;_ylu=c2VjA3NyBHNsawNpbWcEb2lkAzljN2E5YWU0ODY5OGVmZGZlZWQ1NTIxODE2YmEyYmE5BGdwb3MDMwRpdANiaW5n?back=https%3A%2F%2Fimages.search.yahoo.com%2Fsearch%2Fimages%3Fp%3Dtask%2Bmanager%2Blogo%2B%2Bround%2Bpicuters%26ei%3DUTF-8%26type%3DE210US885G91801%26fr%3Dmcafee%26fr2%3Dp%253As%252Cv%253Ai%252Cm%253Asb-top%26tab%3Dorganic%26ri%3D3&w=900&h=520&imgurl=img2.arabpng.com%2F20190216%2Fpff%2Fkisspng-computer-icons-task-management-project-management-task-free-interface-icons-5c67d6ccc2cb09.1797920115503090687979.jpg&rurl=https%3A%2F%2Fwww.arabpng.com%2Fpng-y61anx%2F&size=82.7KB&p=task+manager+logo+round+picuters&oid=9c7a9ae48698efdfeed5521816ba2ba9&fr2=p%3As%2Cv%3Ai%2Cm%3Asb-top&fr=mcafee&tt=%D8%A3%D9%8A%D9%82%D9%88%D9%86%D8%A7%D8%AA+%D8%A7%D9%84%D9%83%D9%85%D8%A8%D9%8A%D9%88%D8%AA%D8%B1%2C+%D8%A7%D9%84%D9%85%D9%87%D9%85%D8%A9%2C+%D8%A5%D8%AF%D8%A7%D8%B1%D8%A9+%D8%B5%D9%88%D8%B1%D8%A9+%D8%A8%D8%A7%D8%A8%D9%88%D8%A7+%D9%86%D9%8A%D9%88+%D8%BA%D9%8A%D9%86%D9%8A%D8%A7&b=0&ni=160&no=3&ts=&tab=organic&sigr=dDmOy31pO25i&sigb=HVQpqPLGzdL0&sigi=A6MggmgsITOW&sigt=xWQGjDQzQnSw&.crumb=IB4TxatnXpm&fr=mcafee&fr2=p%3As%2Cv%3Ai%2Cm%3Asb-top&type=E210US885G91801" /* Replace with your logo image URL */
          alt="Task Manager Logo"
        />
        <ButtonContainer>
          <HighlightedButton to="/login">Login</HighlightedButton>
          <HighlightedButton to="/signup">Sign Up</HighlightedButton>
        </ButtonContainer>
      </WelcomeSection>
    </Container>
  );
};

export default Default;
